import React from 'react';
import Button from './components/UI/Button/Button'

import './App.css';

function App() {
  return (
    <>
      <div className="app">
        <h1>Hi there!</h1>
        <Button />
      </div>
      <div className="app">
        <p>Conditionally render div here</p>
      </div>
    </>
  );
}

export default App;
